    if (argc != 2) {
        printf("Filename is not found");
        return 1;
    }

    const char *filename= argv[1];

    FILE *file = fopen(filename, "r");
    if (file == NULL) {
        printf("File opening error");
        return 1;
    }

    yyin = file;
    yyparse();
    fclose(file);

